    false,nt"url": null,nt"notes": "This annual narrative report for Yazoo,
    Hillside, Panther Swamp, Morgan Brake, and Mathews Brake NWRs covers refuge activities
    during 1997. The report begins with a summary of the year's highlights and weather
    conditions. Land acquisition is covered. The report includes a planning section
    which discusses the management plan, public participation, compliance with environmental
    and cultural resource mandates, and research and investigations. Refuge administration
    is outlined; information about personnel, youth programs, volunteer programs, funding,
    safety, and technical assistance is given. Habitat management is also covered; subjects
    include wetlands, forests, croplands, fire management, pest control, and private
    lands. The wildlife section of the report discusses endangered and threatened species,
    waterfowl, marsh birds and waterbirds, shorebirds, raptors, game mammals, and marking
    and banding. The public uses of the Refuge described in this report include hunting,
    trapping, wildlife observation, and law enforcement. The equipment and facilities
    section of the report provides information about new construction, rehabilitation,
    major maintenance, equipment replacement, computer systems, and energy conservation.
    Cooperative programs are provided at the end",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
